import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './pages/house';
import About from './pages/about';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        {/* Other routes here */}
      </Routes>
    </Router>
  );
};

export default App;
